import React from "react";
import { Text, Stack, useColorMode, Link as ChakraLink } from "@chakra-ui/core";
import Card from "../molecules/card";
import Link from "next/link";

const Settings = () => {
  const { colorMode } = useColorMode();
  return (
    <Card
      gridArea="1 / 1 / 2 / 2"
      heading="Project details"
      pageLink="/settings"
    >
      <Stack isInline my={2}>
        <Text color={`mode.${colorMode}.text`} fontWeight={600}>
          Repository:
        </Text>
        <ChakraLink href="/">
          <Text
            color={`mode.${colorMode}.title`}
            cursor="pointer"
            fontWeight={600}
          >
            Stripe/web-app
          </Text>
        </ChakraLink>
      </Stack>

      <Stack isInline my={2}>
        <Text color={`mode.${colorMode}.text`} fontWeight={600}>
          Current plan:
        </Text>
        <ChakraLink href="/">
          <Text
            color={`mode.${colorMode}.title`}
            cursor="pointer"
            fontWeight={600}
          >
            Pro
          </Text>
        </ChakraLink>
      </Stack>

      <Stack isInline my={2}>
        <Text color={`mode.${colorMode}.text`} fontWeight={600}>
          Configuration:
        </Text>
        <ChakraLink href="/">
          <Text
            color={`mode.${colorMode}.title`}
            cursor="pointer"
            fontWeight={600}
          >
            Strict
          </Text>
        </ChakraLink>
      </Stack>
    </Card>
  );
};

export default Settings;
